import React from 'react';
import Image from 'components/atoms/Image';

import { makeStyles } from '@material-ui/core/styles';
import { Box, Button, Divider } from '@material-ui/core';
import { SectionHeader } from 'components/molecules';
import { Section, SectionAlternate, CardBase } from 'components/organisms';
import {

  FeaturedProducts,
  Hero,

  News,
  Newsletter,
  Overview,


  Reviews,

} from './components';

import {


  news,

  reviews,
} from './data';

const useStyles = makeStyles(theme => ({
  pagePaddingTop: {
    paddingTop: theme.spacing(3),
    [theme.breakpoints.up('md')]: {
      paddingTop: theme.spacing(5),
    },
  },
  sectionNoPaddingTop: {
    paddingTop: 0,
  },
  sectionFeaturedProducts: {
    background: theme.palette.secondary.main,
  },
  reviewSection: {
    background: theme.palette.primary.dark,
  },
}));

const Ecommerce = () => {
  const classes = useStyles();

  return (
    <div>
      <Section className={classes.pagePaddingTop}>
        <Hero />
      </Section>


      <Divider />

      <Section>


        <Box marginBottom={2} display="flex" justifyContent="space-evenly" alignItems="center" padding={2} border="1px solid #ccc" borderRadius="4px">
          <CardBase>
            <Image src="https://assets.maccarianagency.com/the-front/illustrations/brand-platform.svg" />

          </CardBase>
          <SectionHeader
            title="We are reimagining renting to help you achieve your dreams"
            subtitle="Our mission is to help you grow your business, meet and connect with people who share your passions. We help you fulfill your best potential through an engaging lifestyle experience."

            ctaGroup={[(
              <Button color="primary" variant="contained">Submit</Button>
            ), (
              <Button color="primary" variant="outlined">Learn More</Button>
            )]}
          />
        </Box>



      </Section>



      <Section className={classes.sectionNoPaddingTop}>
        <Overview />
      </Section>
      <br />
      <br />
      <br />
      <br />
      <br />
      <br />


      <SectionAlternate>

        <FeaturedProducts />
      </SectionAlternate>
      {/* <Section>
        <Products data={featuredProducts} />
      </Section>
      <SectionAlternate>
        <Sales data={mostSoldProducts} />
      </SectionAlternate> */}
      <Section>
        <News data={news} />
      </Section>
      {/* <Section className={classes.sectionNoPaddingTop}>
        <LatestProducts data={latestProducts} />
      </Section> */}
      {/* <Section className={classes.sectionNoPaddingTop}>
        <QuickSearch />
      </Section> */}
      <SectionAlternate >
        <Reviews data={reviews} />
      </SectionAlternate>
      <Section>
        <Newsletter />
      </Section>
    </div>
  );
};

export default Ecommerce;
